const TickerInput = () => {
  return (

      <form>
          <div>
              <label htmlFor="">Ticker name</label>
              <input type="text" placeholder="add ticker"/>
          </div>
          <input type="submit" value="add"/>
      </form>

  );
};

export default TickerInput;
